// lib/features/auth/presentation/bloc/admin_dashboard_event.dart
part of 'admin_dashboard_bloc.dart';

@freezed
class AdminDashboardEvent with _$AdminDashboardEvent {
  const factory AdminDashboardEvent.loaded() = _Loaded;
  const factory AdminDashboardEvent.refreshRequested() = _RefreshRequested;
}

// lib/features/auth/presentation/bloc/admin_dashboard_state.dart
part of 'admin_dashboard_bloc.dart';

@freezed
class AdminDashboardState with _$AdminDashboardState {
  const factory AdminDashboardState.initial() = AdminDashboardInitial;
  const factory AdminDashboardState.loading() = AdminDashboardLoading;
  const factory AdminDashboardState.loaded({
    required int pendingRequestsCount,
    required int totalUsersCount,
  }) = AdminDashboardLoaded;
  const factory AdminDashboardState.failure(Failure failure) = AdminDashboardFailure;
}
